function service() {
    const getAllProfiles = async() => {
      return fetch(
        "https://templates.buildwoofunnels.com/users.json",
        {
          method: "GET",
          headers: {
            "x-rapidapi-host": "asos2.p.rapidapi.com",
            "x-rapidapi-key":
              "1949ed3468msh573f2b5adccd778p14beffjsn12e69f0cac40",
          },
        }
      )
        .then((res) => res.json())
        .then((data) => data.profiles)
        .catch((e) => e);
    };

    return {
      getAllProfiles,
    };
  }

  const profilesService = service();

  export default profilesService;
